-- Create Tables
CREATE TABLE HealthExpenditure (
    ID INT PRIMARY KEY,  -- Unique ID for the HealthExpenditure table
    Year INT NOT NULL,
    Gender CHAR(1) NOT NULL,
    AgeGroup VARCHAR(11) NOT NULL,
    TotalCurrentDollars INT NOT NULL,
    TotalCurrentDollarsPerCapita INT NOT NULL
);

CREATE TABLE SurgicalWaitTimes (
    ID INT PRIMARY KEY,  -- Unique ID for the SurgicalWaitTimes table
    Year INT NOT NULL,
    HealthAuthority VARCHAR(255) NOT NULL,
    HospitalName VARCHAR(255) NOT NULL,
    Category VARCHAR(255) NOT NULL,  
    Waiting INT NOT NULL,
    Completed INT NOT NULL,
    Completed_50th_Percentile DECIMAL(5, 2),
    Completed_90th_Percentile DECIMAL(5, 2)
);

CREATE TABLE HealthExpenditure_SurgicalWaitTimes (
    health_expenditure_surgical_wait_time_id INT PRIMARY KEY,  -- Unique ID for the HealthExpenditure_SurgicalWaitTimes table
    Year INT NOT NULL,
    Gender CHAR(1) NOT NULL,
    AgeGroup VARCHAR(11) NOT NULL,
    HealthAuthority VARCHAR(255) NOT NULL,
    HospitalName VARCHAR(255) NOT NULL,
    Category VARCHAR(255) NOT NULL,
    -- Foreign keys to link to the other tables, but not using the original primary key
    FOREIGN KEY (Year, Gender, AgeGroup) REFERENCES HealthExpenditure(Year, Gender, AgeGroup)
        ON DELETE CASCADE,
    FOREIGN KEY (Year, HealthAuthority, HospitalName, Category) REFERENCES SurgicalWaitTimes(Year, HealthAuthority, HospitalName, Category)
        ON DELETE CASCADE
);

